import FocusedDataItem from "./focusedDataItem"

//Extends FocusedData
export default function FocusedDataList({focusedItem}) {
  return (
    <div style={{fontSize: "11px", height: "20px"}}>
      <FocusedDataItem itemObject={focusedItem.resources[0].data}/>
    </div>
  )
}
